import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Navbar from './components/Navbar';
import DashboardRouter from './DashboardRouter';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <DashboardRouter />
      </div>
    </Router>
  );
}

export default App;
